import React from 'react'

interface Properties {
    placeholder: string;
    id: string;
    type: string;
}

const Input: React.FC<Properties> = (props) => {
    return(
        <div className="input-block">
            <input placeholder={props.placeholder} type="text" id={props.id}/>
        </div>
    );
}

export default Input;
